import React from "react";
import Navbar from "../../components/navbar";
import Banner from "../../components/banner";
import Grid from "../../components/grid";
import Collage from "../../components/collage"
import Bio from "../../components/bio"
import Contact from "../../components/contact";
import Footer from "../../components/footer";
import { Link } from "react-router-dom";

require ("./home.css");

class home extends React.Component {
    constructor(props) {
    super(props);
        this.state = {

        }
    }

    render() {
        return (
            <div id="homeMainContainer" className="container-fluid" data-spy="scroll" data-target="#list-example" data-offset="0">
                {/* <Navbar /> */}
                <div id="homeResponsiveTopNav" className="d-flex justify-content-center">
            <div className="homeResponsiveTopNavHoverHome">
                <a className="justify-content-center align-items-center topNavText" href="#bannerMainContainer">Home</a>   
            </div>
            <div className="overlayNav"></div>
            <div className="homeResponsiveTopNavHoverProfile">
                <a className="justify-content-center align-items-center topNavText" href="#mainGridContainer">Grid</a>
            </div>
            <div id="overlayNav"></div>
            <div className="homeResponsiveTopNavHoverProjects">
                <Link to="/portfolio">
                    <h3 className="justify-content-center align-items-center topNavText">
                            About
                    </h3>
                </Link>
            </div>
            <div id="overlayNav"></div>
            <div className="homeResponsiveTopNavHoverSkills">
                <Link to="/experience">
                    <h3 className="justify-content-center align-items-center topNavText">
                            Contact
                    </h3>
                </Link>
            </div>
            <div id="overlayNav"></div>
            <div className="homeResponsiveTopNavHoverContact">
                <Link to="/contact">
                    <h3 className="justify-content-center align-items-center topNavText">
                            Helful Links
                    </h3>
                </Link>
            </div>
            <div id="overlayNav"></div>
          </div>
                <Banner />
                <Grid />
                {/* <Collage /> */}
                <Bio />
                <Contact />
                <Footer />
            </div>
        )
    }
}

export default home;
